import { RaisedButton, TextField } from '@material-ui/core';
import { Form, Formik } from 'formik';
import * as React from 'react';

interface Values {
    firstName: string;
    lastName: string;
    email: string;
    msg: string; // This is not a large enough variable type but for now it'll do.
}


interface Props {
    onSubmit: (values: Values) => void; //Values as my parameter



}

export const MkForm: React.FC<Props> = ({ onSubmit }) => {
    return (
        <Formik
        initialValues={{firstName: '', lastName: '', email: '', msg: ''}} 
        onSubmit={(values) => {
            onSubmit(values);
        }}>
            {({ values, handleChange, handleBlur}) => (
                <Form>
                    <TextField 
                        name="firstName" 
                        id="outlined-basic" 
                        label="First Name" 
                        variant="outlined"
                        value={values.firstName}
                        onChange={handleChange}
                        onBlur={handleBlur}

                        />;

                    <RaisedButton type="submit">Submit</RaisedButton>
                </Form>
            )}
        </Formik>
    );
}
